import React from 'react'
import Sidebar from './components/fixedComponents/sidebar';
import Header from './components/fixedComponents/header';
import Home from './components/home/HomeChart'

function App(){
  return(
    <div>
      <Header />
      <Sidebar />
      <div className="home">
        Seja bem Vindo, selecione as opções do menu para continuar.
      </div>
      <div className="graficos">
        <Home />
      </div>
    </div>
  )
}

export default App
